import sys
import time
import zipfile
import os
import gzip
import base64
import datetime
from subprocess import Popen, PIPE
import platform

DEBUG = True

ENCPROC = """

"""


def main(pid):
	Exename = ""
	with open('procdump.zip', 'wb') as f:
		f.write(base64.b64decode(ENCPROC))
	time.sleep(2)
	with zipfile.ZipFile('procdump.zip', 'r') as zip_ref:
		zip_ref.extractall('.')
	time.sleep(2)

	if platform.architecture()[0] == '64bit':
		if platform.uname()[0] == 'ARM64':
			Exename = 'procdump64a.exe'
		else:
			Exename = 'procdump64.exe'
	else:
		Exename = 'procdump.exe'
	Hostname = os.getenv('COMPUTERNAME')
	DateofFile = datetime.datetime.now().strftime("%Y%m%d-%H%M%S")

	Filename = DateofFile+"-"+Hostname + "-" + str(pid) + '.dmp'
	if DEBUG: print("[DEBUG] : command = "+Exename + ' -accepteula -ma ' + str(pid) + " " + Filename)
	process = Popen([Exename, '-accepteula', '-ma', str(pid), Filename], stdout=PIPE, stderr=PIPE)
	stdout, stderr = process.communicate()
	if DEBUG: print("STDOUT = " + str(stdout))
	if DEBUG: print("STDERR : " + str(stderr))
	time.sleep(2)
	os.remove('Eula.txt')
	os.remove('procdump.zip')
	os.remove('procdump64.exe')
	os.remove('procdump64a.exe')
	os.remove('procdump.exe')
	time.sleep(2)
	if os.path.exists(Filename):
		with open(Filename, 'rb') as f_in, gzip.open(Filename + '.zip', 'wb') as f_out:
			f_out.writelines(f_in)
		time.sleep(2)
		os.remove(Filename)
		return {'files_to_get': Filename + '.zip'}
	else:
		return str(stdout) + str(stderr)

if __name__ == "__main__":
	print(main(sys.argv[1]))
